SCRIPT.MSCRI:
#!/bin/bash ######################################################################################################## # The Script Takes in the service name & the Artifact(version) number as inputs and calls a curl # # statement to the GO Pipeline to deploy the artifact to QA # # # # Created by: Infrastructure Engineering Date: 06-17-2015 # # Version 1 by: Chinmay Bhatawdekar Date: 05-13-2016 # ########################################################################################################
function start(){ curl -u puppet:mpick@infra -d "materials\[&BUILD_NAME\]=&BUILD_NAME/&ARTIFACT/&BUILD_LOC/&BUILD_VERSION" http://&GOSERVER/go/api/pipelines/&PIPELINE_NAME/schedule if [ "$?" -ne 0 ]; then exit 0 fi sleep 120 echo "Waiting for go release pipeline to finish" while [ -e /tmp/&BUILD_NAME.running ]; do sleep 120 done
} function main(){ start } main

